const Voter = (props) => {
    return (
      <tr>
        <td>{props.id}</td>
        <td>{props.name}</td>
        <td>{props.address}</td>
        <td>{props.social_number}</td>
        <td>
          <form>
          <button type="submit">Delete</button>
          </form>
  
        </td>
      </tr>
    );
  };
  
  export default Voter;
